import React from 'react';

const Homepage = () => {
  return (
    <div>
      <h1>Welcome to the Lunch Vote App</h1>
      <p>Choose a restaurant to vote for lunch today.</p>
      <p><a href="/restaurants">View Restaurants</a></p>
      <p><a href="/winner">See Today's Winner</a></p>
    </div>
  );
};

export default Homepage;
